import './App.css';


function App() {
  return (
    <div className="container">
      <HeaderApp />
      <NavApp />
      <MainApp />
      <FooterApp />
    </div>
  );
}

function HeaderApp() {
  return (
    <header className="headerApp">
      HeaderApp

    </header>
  );
}

function NavApp() {
  return (
    <nav className="navApp">
      NavApp
    </nav>
  );
}

function MainApp() {
  return (
    <main className="MainApp">
      MainApp
    </main>
  );
}

function FooterApp() {
  return (
    <footer className="footerApp">
      FooterApp
    </footer>
  );
}

export default App;
